disableDozeText:
Att inaktivera “Doze mode” för {Config.appName} kan hjälpa din app att hålla sig uppdaterad mot nätverket bättre. Doze mode kan avbryta bakgrundssynkning för att spara batteri, speciellt när du inte använder din telefon.{

}För att avaktivera Doze mode, klicka på länken nedan, välj sedan “Alla apps”.{

}Skrolla sedan ned till {Config.appName}, klicka på den, välj sedan “Optimera inte”.{

}Klicka sedan på färdig så är det klart!{

}
